import { Container } from "react-bootstrap";

const LocationSearch = () => {


    return (
        <Container>
            <label for="location"><i class="fa-solid fa-location-dot"></i> Find your Own Tattoo Artist.</label>
            <input type="search" className="" name="city" />

            <button>Search</button>
        </Container>
    );
}

export default LocationSearch;
